import React from 'react'

export default function Button(props) {

  return (
    <button 
    style="
      background: #0b42c2;
      color: #fff;
      border: 0;
      padding: 10px 15px;
      cursor: pointer;
      margin-top: 15px;
      font-weight: bold;
      font-size: 14px;" onClick={props.function}>{props.counter === 0 ? 'Vamo Contar?' : 'Adicionar 1'}</button>
  )
}
